  nameWithType: SymDocument
  fullName: System.Diagnostics.SymbolStore.SymDocument
  type: Class
  summary: "Представляет документ, указанный в хранилище символов."
  remarks: "Документ определяется URL-адрес и идентификатором GUID типа документа. С помощью документа введите идентификатор GUID и URL-адрес, можно найти документ. Источник документа можно сохранять в хранилище символов.       Этот интерфейс также предоставляет доступ к этому источнику, при его наличии."
